INSERT INTO `v1_61e58b7ef824940fee0d4d022ad6350365d080c0ef50600bbac2c78301a84f01` VALUES (1, 11, "ふむ、よい趣向ですね。\n敬うべき相手を忘れず、恩を忘れず、\n健勝を祝う宴を開く……\n礼節を弁えた人間は好きですよ。", 0, 1070501040, 1, 4, "", 107011, 0, 1070501);
INSERT INTO `v1_61e58b7ef824940fee0d4d022ad6350365d080c0ef50600bbac2c78301a84f01` VALUES ("", 91, "", "", 1070501041, "", "", "", 0, "", 1070501);
