INSERT INTO `v1_61e58b7ef824940fee0d4d022ad6350365d080c0ef50600bbac2c78301a84f01` VALUES (1, 11, "ただ、そうですね……\n厚意に預かるばかり、\nというのも性に合いませんし。\n何かご褒美をあげましょう。", 0, 1070501046, 1, 5, "", 107011, 0, 1070501);
INSERT INTO `v1_61e58b7ef824940fee0d4d022ad6350365d080c0ef50600bbac2c78301a84f01` VALUES ("", 91, "", "", 1070501047, "", "", "", 0, "", 1070501);
