INSERT INTO `v1_61e58b7ef824940fee0d4d022ad6350365d080c0ef50600bbac2c78301a84f01` VALUES (1, 11, "ほわあああぁぁ何この蝋燭！？\n思わず知的興奮で吹き消してしまったが\n怪しい残り香、興味深ぁ～！\n鼻腔から学び入ってくる～！", 0, 1110501040, 1, 5, "", 111011, 0, 1110501);
INSERT INTO `v1_61e58b7ef824940fee0d4d022ad6350365d080c0ef50600bbac2c78301a84f01` VALUES ("", 91, "", "", 1110501041, "", "", "", 0, "", 1110501);
INSERT INTO `v1_61e58b7ef824940fee0d4d022ad6350365d080c0ef50600bbac2c78301a84f01` VALUES (0, 21, "vo_adv_1110501_001", "", 1110501042, "", 0, "", "vo_adv_1110501", "", 1110501);
INSERT INTO `v1_61e58b7ef824940fee0d4d022ad6350365d080c0ef50600bbac2c78301a84f01` VALUES (1, 11, "この蝋燭は、もしや君が作ったのか？\nなに、精油にそんな希少な成分を？\nわざわざぼくの誕生日を祝うために？\n後輩……君という子は……！", 0, 1110501043, 1, 4, "", 111011, 0, 1110501);
INSERT INTO `v1_61e58b7ef824940fee0d4d022ad6350365d080c0ef50600bbac2c78301a84f01` VALUES ("", 91, "", "", 1110501044, "", "", "", 0, "", 1110501);
INSERT INTO `v1_61e58b7ef824940fee0d4d022ad6350365d080c0ef50600bbac2c78301a84f01` VALUES (0, 21, "vo_adv_1110501_002", "", 1110501045, "", 0, "", "vo_adv_1110501", "", 1110501);
INSERT INTO `v1_61e58b7ef824940fee0d4d022ad6350365d080c0ef50600bbac2c78301a84f01` VALUES (1, 11, "しかし蝋燭はいいが、この土台部分──\nいや、バースデーケーキとかいう祝祭の\n文化か。ううむ気持ちは有難いが、\n食の細いぼくには若干拷問サイズだ……", 0, 1110501046, 1, 4, "", 111011, 0, 1110501);
INSERT INTO `v1_61e58b7ef824940fee0d4d022ad6350365d080c0ef50600bbac2c78301a84f01` VALUES ("", 91, "", "", 1110501047, "", "", "", 0, "", 1110501);
INSERT INTO `v1_61e58b7ef824940fee0d4d022ad6350365d080c0ef50600bbac2c78301a84f01` VALUES (0, 21, "vo_adv_1110501_003", "", 1110501048, "", 0, "", "vo_adv_1110501", "", 1110501);
INSERT INTO `v1_61e58b7ef824940fee0d4d022ad6350365d080c0ef50600bbac2c78301a84f01` VALUES (1, 11, "ややっ？　よくよく見ればこの土台、\nケーキなのはほんの一部分だけで、\n大半はよく出来た模造品じゃあないか！\nな、なんと配慮の行き届いた……！", 0, 1110501049, 1, 5, "", 111011, 0, 1110501);
INSERT INTO `v1_61e58b7ef824940fee0d4d022ad6350365d080c0ef50600bbac2c78301a84f01` VALUES ("", 91, "", "", 1110501050, "", "", "", 0, "", 1110501);
